import Container from "react-bootstrap/esm/Container";
import mySkills from "./MySkills";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import SkillItem from './SkillItem';
import Card from 'react-bootstrap/Card';

Object.keys(mySkills).map((key) => {
    Object.keys(mySkills[key]).map((innerKey) => {
        console.log(`${key}: ${innerKey} : ${mySkills[key][innerKey]}`)
    })
    console.log('------------------')
})



function Skills() {

    


    return (

        <section className = 'myskills-section Poppins' id ='skills'>
            <Container fluid>

            <Col className ='myskills-header'>
                <h1>My Skills</h1>
            </Col>

            
            {
                Object.keys(mySkills).map((key) => {
                
                return <div>
                            <Row className = 'skill-row mt-5 pt-5 mb-3'>
                            <h1 className = 'skill-header'>{key}</h1>
                            <Row className='justify-content-around'>
                            {Object.keys(mySkills[key]).map((innerKey) => {
                        return <Card style={{ width: '12rem',backgroundColor:'none' }}>
                                <Card.Img variant="top" src={`../images/Skills/${innerKey}.png`} />
                                <Card.Body >
                                    <Card.Title className='text-center'>{innerKey}</Card.Title>
                                    <Card.Text className='text-center'>
                                        <div className = 'text-center outer-progress-bar'>
                                            <div className = 'text-center inner-progress-bar' style = {{width: `${mySkills[key][innerKey]}%`}}> 
                                                <span>{mySkills[key][innerKey]}%</span>                  
                                            </div>
                                        </div>
                                    </Card.Text>
                                </Card.Body>
                                </Card>
                    })}
                            </Row>
                        </Row>


                    </div>
                        
                    
                })
                
            }

            
                   
                
            
            
            <br /><br /><br /><br /><br /><br /> <br /><br /><br /><br /><br /><br />
            </Container>
        </section>


    )



}

export default Skills;
